import Product from "../Product";
import Title from "../Tittle";
import styles from "./styles.module.css";

const Sale = ({ products, link = false }) => {
  return (
    <section className={link ? styles.saleSection : styles.saleSectionNotLink}>
      <Title title="Sale" link={link} />

      <Product products={products} />
    </section>
  );
};
export default Sale;
